import React from 'react'
import './Fog.css'

export default class Fog extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return(
    <div className="lightSnowContainer">
    <canvas id="fog"></canvas>
  </div>
  )
  }

}
